import React from "react";
import style from "./Home.module.css"; 

const Home = () => {
  return (
    <div className={style.homeContainer}>
      <h1>Bienvenido a mi Portafolio</h1>
      <img src={'yo.jpg'} alt="Mi Foto de Perfil" className={style.profileImage} />
      <p>MI ÚLTIMO TRABAJO</p>
      <img
        src={'imagenpf.png'} // Reemplaza 'imagen-proyecto.jpg' con la ruta de tu imagen de proyecto
        alt="Mi Último Proyecto" // Proporciona un texto descriptivo para la imagen
        className={style.projectImage} // Establece una clase CSS para la imagen si es necesario
      />
    </div>
  );
};

export default Home;
